  return (
    <React.Fragment>
      <header className="header">
        <h1>Foodies</h1>
        <button>Cart</button>
      </header>
      <div className="main-image">
        <img src={MealImage} alt="Dilicious Food Image"></img>
      </div>
    </React.Fragment>
  );
};

export default Header;
